import React from 'react';

const Auth = () => {
    const handleLogin = () => {
        // Перенаправлення на Google для авторизації
        window.location.href = 'http://localhost:3000/auth/google';
    };

    return (
        <div>
            <button onClick={handleLogin}>Login with Google</button>
        </div>
    );
};

export default Auth;
